import './App.css';
import {Container, Row, Col} from 'react-bootstrap';
import NavigationBar from './components/NavigationBar';
import Footer from './components/Footer';



function App() {

  const marginTop = {
    marginTop: "20px"
  };

  return (
    <Router className = "app">
      <NavigationBar>
        <Container>
          <Row>
            <Col lg ={12} style={marginTop}>
              asda
            </Col>
          </Row>
        </Container>
      </NavigationBar>

      <Footer>
        dsfasda
      </Footer>
    </Router>
  );
}

export default App;
